// BotCollection.js
import React from "react";
import BotCard from "./BotCard";

function BotCollection({ bots, addToArmy }) {
  return (
    <div className="ui four column grid">
      <div className="row">
        {bots.map((bot) => (
          <BotCard key={bot.id} bot={bot} addToArmy={addToArmy} />
        ))}
      </div>
    </div>
  );
}

export default BotCollection;
